import './App.css';
import './assets/Home';

import MainPage from "../src/components/MainPage/MainPage"
import VLibras from 'vlibras-react';
// import Vlibras from './components/Vlibras/Vlibras.json'
// import VLibras from '@moreiraste/react-vlibras/dist/types';


function App() {
  return (
    <>
    <VLibras widgetSrc={'https://vlibras.gov.br/app'} scriptSrc={'https://vlibras.gov.br/app/vlibras-plugin.js'} />
    <MainPage />
    </>
  );
}
export default App;
